import React, { Component, Fragment } from 'react'
import './contact.css'
import PropTypes from 'prop-types'

class Contact extends Component {

    state = {
        isActiveShowContact: false
    } 

    showContact(ss) {
        console.log('salam 3alikom', ss)
        this.state.isActiveShowContact = false;
    }
    render() {
        const {nom , tel , email } = this.props.data;
        return (
            <Fragment>
                <div className="card">
                    <div className="card-body">
                        <h4 className="card-title"> 
                         { nom} <i onClick = { this.showContact.bind(this, nom) } className="fa fa-sort-down"> </i> </h4>
                         <hr />
                        <div className="card-text">
                            {(this.state.isActiveShowContact) ? (
                              <ul className="list-group">
                                <li className="list-group-item"> { tel }   </li>
                                <li className="list-group-item"> { email } </li>
                              </ul>
                            ): null }
                        </div>
                    </div>
                </div>

            </Fragment>
        )
    }
}

Contact.defaultProps = {
    nom : "name required",
    tel : "tel required",
    email : "email required"
}

Contact.propTypes = {
    data : PropTypes.object.isRequired
}

export default Contact;
